template <int T>
ap_uint<T> xf_satcast(int in_val) {
    if (in_val > ((1 << T) - 1)) {
        return ((1 << T) - 1);
    } else if (in_val < 0) {
        return 0;
    } else {
        return in_val;
    }
}

